import React from 'react';
import {useLocation} from 'react-router-dom'

const Detail = () => {
  const {state} = useLocation()
  return (
    <ul>
      <li>state.id</li>
      <li>state.title</li>
      <li>state.id</li>
    </ul>
  );
}

export default Detail;
